"use strict";

const math = require('mathjs');

function f_gold(points) {
    let min_x = Infinity, max_x = -Infinity;
    let point_set = new Set();
    for (let [x, y] of points) {
        min_x = Math.min(min_x, x);
        max_x = Math.max(max_x, x);
        point_set.add([x, y]);
    }
    let s = min_x + max_x;
    for (let [x, y] of points) {
        if (!point_set.has([s - x, y])) {
            return false;
        }
    }
    return true;
}
